import React from "react";
import Highcharts from 'highcharts';
import HighchartsReact from "highcharts-react-official";
import drilldown from "highcharts/modules/drilldown"
import mlData from '../allData/mlData';

function DrillDownPie() {
  drilldown(Highcharts);
  let options = {
    chart:
    {
      type: 'pie',
      backgroundColor:'transparent',
      height:'300px'
    },
    plotOptions:
    {
      pie:
      {
        borderWidth:0.5
      }
    },
    title: 
    {
      style:{color:'white',fontSize:'15px',fontFamily:'cursive'},
      text: '(Click on each section for more info)'
      
    },
    series: [
      {
          name: "Main",
          colorByPoint: true,
          data: [
              {
                  name: "NLP",
                  y: 30.00,
                  drilldown: "NLP"
              },
              {
                  name: "RecSys",
                  y: 25.00,
                  drilldown: "RecSys"
              },
              {
                  name: "FrameWorks",
                  y: 15.00,
                  drilldown: "FrameWorks"
              },
              {
                  name: "Other",
                  y: 30.00,
                  drilldown: "Other"
              }
          ]
      }
  ],
  drilldown: {
      series: [
          {
              name: "NLP",
              id: "NLP",
              data: [
                  [
                      "MultiClass Classification",
                      20.00
                  ],
                  [
                      "SentimentAnalysis",
                      30.00
                  ],
                  [
                      "Topic Modeling",
                      20.00
                  ],
                  [
                      "NER",
                      15.00
                  ],
                  [
                      "Extractive Summarization",
                      15.00
                  ]
              ]
          },
          {
              name: "RecSys",
              id: "RecSys",
              data: [
                  [
                      "Content-based",
                      40
                  ],
                  [
                      "Collaborative Filtering",
                      30
                  ],
                  [
                      "KNN",
                      30
                  ],
                  [
                      "v55.0",
                      0.11
                  ],
                  [
                      "v54.0",
                      0.1
                  ],
                  [
                      "v52.0",
                      0.95
                  ],
                  [
                      "v51.0",
                      0.15
                  ],
                  [
                      "v50.0",
                      0.1
                  ],
                  [
                      "v48.0",
                      0.31
                  ],
                  [
                      "v47.0",
                      0.12
                  ]
              ]
          },
          {
              name: "Internet Explorer",
              id: "Internet Explorer",
              data: [
                  [
                      "v11.0",
                      6.2
                  ],
                  [
                      "v10.0",
                      0.29
                  ],
                  [
                      "v9.0",
                      0.27
                  ],
                  [
                      "v8.0",
                      0.47
                  ]
              ]
          },
          {
              name: "Safari",
              id: "Safari",
              data: [
                  [
                      "v11.0",
                      3.39
                  ],
                  [
                      "v10.1",
                      0.96
                  ],
                  [
                      "v10.0",
                      0.36
                  ],
                  [
                      "v9.1",
                      0.54
                  ],
                  [
                      "v9.0",
                      0.13
                  ],
                  [
                      "v5.1",
                      0.2
                  ]
              ]
          },
          {
              name: "Edge",
              id: "Edge",
              data: [
                  [
                      "v16",
                      2.6
                  ],
                  [
                      "v15",
                      0.92
                  ],
                  [
                      "v14",
                      0.4
                  ],
                  [
                      "v13",
                      0.1
                  ]
              ]
          },
          {
              name: "Opera",
              id: "Opera",
              data: [
                  [
                      "v50.0",
                      0.96
                  ],
                  [
                      "v49.0",
                      0.82
                  ],
                  [
                      "v12.1",
                      0.14
                  ]
              ]
          }
      ]},
        
    credits: {
      enabled:false
    }
  }


  return (
    <span>
      <HighchartsReact 
        highcharts={Highcharts}
        options={options}
      />
    </span>
  )
}

export default DrillDownPie;
